import { Card } from "react-bootstrap";


function Form() {
    return (
        <Card>
            <Form>
            <Form.Select aria-label="Default select example">
      <option>Open this select menu</option>
      <option value="1">One</option>
      <option value="2">Two</option>
      <option value="3">Three</option>
    </Form.Select>
            </Form>
        </Card>
    )
}

export default Form;
